## 1. Introduction to `useEffect` <a name="introduction-to-useeffect"></a>

In React, side effects are operations that can affect other components or can't be done during rendering. Examples include:
- Fetching data from an API
- Setting up a subscription
- Manually changing the DOM
- Logging

The `useEffect` hook provides a way to run these side effects after the component has rendered. It combines the capabilities of `componentDidMount`, `componentDidUpdate`, and `componentWillUnmount` from class components into a single API.

## 2. Basic Syntax <a name="basic-syntax"></a>

The basic syntax of `useEffect` is:

```javascript
useEffect(() => {
  // Side effect logic here

  return () => {
    // Cleanup logic here (optional)
  };
}, [dependencies]); // Dependency array
```

- The first argument is a function that contains the side effect logic.
- The second argument is an optional array of dependencies. This array tells React when to re-run the effect.
- The cleanup function (returned from the effect) is optional and runs when the component unmounts or before re-running the effect.

## 3. When to Use `useEffect` <a name="when-to-use-useeffect"></a>

Use `useEffect` when you need to:
- Perform data fetching
- Set up event listeners
- Manipulate the DOM directly
- Set up timers or intervals
- Subscribe to data sources
- Perform any operation that should happen after the render is committed to the screen

Avoid using `useEffect` for:
- State transformations that can be done during rendering
- Event handlers (use event handlers instead)
- Computations that can be derived from state/props (use `useMemo` instead)

## 4. Dependency Array Explained <a name="dependency-array-explained"></a>

The dependency array controls when the effect runs:
- **No dependency array**: The effect runs after every render.
  ```javascript
  useEffect(() => {
    // Runs after every render
  });
  ```

- **Empty dependency array (`[]`)**: The effect runs only once after the initial render (similar to `componentDidMount`).
  ```javascript
  useEffect(() => {
    // Runs once after initial render
  }, []);
  ```

- **Dependencies provided (`[dep1, dep2]`)**: The effect runs after the initial render and whenever any dependency changes (similar to `componentDidUpdate` for those dependencies).
  ```javascript
  useEffect(() => {
    // Runs after initial render and whenever dep1 or dep2 changes
  }, [dep1, dep2]);
  ```

### Important Rules for Dependencies
1. Include all values from the component scope (props, state, context, etc.) that change over time and are used inside the effect.
2. If you omit a dependency, you might end up with stale data in your effect.
3. Use the ESLint plugin for React Hooks to catch missing dependencies.

