### 题目描述

设计一个数据结构，支持以下操作：

- insert(val)：向数据结构中插入元素 val。
- remove(val)：从数据结构中删除元素 val。
- getRandom：随机返回数据结构中的一个元素，每个元素被返回的概率应该相同。

要求所有操作的时间复杂度均为 O(1)。

### 解决方案

为了满足 O(1) 时间复杂度的要求，我们可以结合使用哈希表和动态数组：

- 动态数组：用于存储元素，支持 O(1) 的随机访问。
- 哈希表：用于存储元素值到数组索引的映射，支持 O(1) 的插入和删除。

具体实现如下：

- 插入操作：将元素添加到数组末尾，并在哈希表中记录该元素对应的索引。
- 删除操作：将要删除的元素与数组末尾元素交换，然后删除末尾元素，并更新哈希表中原末尾元素的索引。
- 随机获取操作：生成一个随机索引，返回数组中对应位置的元素。

